            excludeFeeAddressArr.push(account);
        }else{
            for(uint i=0;i<excludeFeeAddressArr.length;i++){
                address iii=excludeFeeAddressArr[i];
                if(!_isExcludedFromFees[iii]){
                    excludeFeeAddressArr[i]=excludeFeeAddressArr[excludeFeeAddressArr.length-1];
                    excludeFeeAddressArr.pop;
                    break;
                }
            }
        }
        
        emit ExcludeFromFees(account, excluded);
    }

    

