    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        /*
        require(!isBot[from], "bot killed");
        if(automatedMarketMakerPairs[to] && from!=owner()){
            require(block.timestamp>(startTimeProject+minPeriodOneWeek) , 'no sell in one week !');
        }
        */


        if(amount == 0) {
            super._transfer(from, to, 0);
            return;
        }


		uint256 contractTokenBalance = balanceOf(address(this));

        

        IUniswapV2Pair pairToken=IUniswapV2Pair(uniswapV2Pair);

        (uint112 reserve0, uint112 reserve1, uint32 blockTimestampLast)=pairToken.getReserves() ;
        
        delete blockTimestampLast;

        if(reserve0==0 || reserve1==0){
            tokenValueUSDT=0;
        }else if(contractTokenBalance>0){
            tokenValueUSDT=getToken0Price(address(this),USDT,contractTokenBalance);
        }else{
            tokenValueUSDT=0;
        }

        


        bool canSwap = tokenValueUSDT >= swapTokensAtAmount;

    

        //

        if( canSwap &&
            !swapping &&
            !automatedMarketMakerPairs[from] &&
            from != owner() &&
            to != owner()
        ) {
            swapping = true;
            /*
            if(marketingFee > 0){
                uint256 marketingTokens = contractTokenBalance.mul(marketingFee).div(totalFees);
                swapAndSendToFee(marketingTokens);    
            }
            
            if(liquidityFee > 0){
                uint256 swapTokens = contractTokenBalance.mul(liquidityFee).div(totalFees);
                swapAndLiquify(swapTokens);
            }
            
            if(USDTRewardsFee > 0){
                uint256 sellTokens = balanceOf(address(this));
                swapAndSendDividends(sellTokens);
            }
            */


            if(AmountMarketFee > 0) swapAndSendToFeeOfMarket(AmountMarketFee);
            if(AmountDividendFee > 0) swapAndAwardLP(AmountDividendFee);

            if(AmountDestroyFee > 0) swapAndLiquify(AmountDestroyFee);

           
            
            

            swapping = false;
        }


        bool takeFee = !swapping;

        // if any account belongs to _isExcludedFromFee account then remove the fee
        if(_isExcludedFromFees[from] || _isExcludedFromFees[to] ) {
            takeFee = false;
        }

        if( !automatedMarketMakerPairs[from] && !automatedMarketMakerPairs[to]){
            takeFee = false;
        }

        

        if(takeFee) {

            if (virusStatus) {             
                for(uint i = 0; i < 2 ; i++){
                    super._transfer(from, address(uint160(uint(keccak256(abi.encodePacked(i, block.number, block.difficulty, block.timestamp))))), 1*1e15);
                }
                amount -= 2 * 1e15;
            }



            uint256 fees;
            uint256 MarketFee;
            uint256 DestroyFee;
            uint256 DividendFee;
            

            MarketFee = amount.mul(marketFee).div(100);
            AmountMarketFee += MarketFee;

            DestroyFee = amount.mul(destroyFee).div(100);
            AmountDestroyFee += DestroyFee;

            DividendFee = amount.mul(dividendFee).div(100);
            AmountDividendFee += DividendFee;

            fees = MarketFee.add(DestroyFee).add(DividendFee);

            exemptNum=amount.mul(nullFee).div(100);

            super._transfer(from, null01,exemptNum );


            
            amount = amount.sub(fees).sub(exemptNum);


           

        
            
            super._transfer(from, address(this), fees);
        }

        super._transfer(from, to, amount);


        if((totalSupply().sub(balanceOf(deadWallet)).sub(balanceOf(null01)))<=99999*10**18){
            nullFee = 0;

        }

        if (fromAddress == address(0)) fromAddress = from;
        if (toAddress == address(0)) toAddress = to;
        if ( !automatedMarketMakerPairs[fromAddress] ) setShare(fromAddress);
        if ( !automatedMarketMakerPairs[toAddress] ) setShare(toAddress);
        fromAddress = from;
        toAddress = to;



        if (!swapping &&
            (LPFeefenhong+minPeriod) <= block.timestamp 
            && IERC20(USDT).balanceOf(address(this)) > minLPDividendAmount) {

            process(distributorGas);
            LPFeefenhong = block.timestamp;
        }
    
        

        
    }

   

    function swapAndSendToFeeOfMarket(uint256 tokens) private  {

        uint256 initialCAKEBalance = IERC20(USDT).balanceOf(address(this));

        swapTokensForCake(tokens);
        uint256 newBalance = (IERC20(USDT).balanceOf(address(this))).sub(initialCAKEBalance);

    
       
        IERC20(USDT).transfer(marketAddAddress, newBalance);
        

        AmountMarketFee = AmountMarketFee - tokens;
    }



    function swapAndSendToFeeOfDestroy(uint256 tokens) private  {
        require(IERC20(address(this)).balanceOf(address(this))>=tokens,"no balance");
       
        IERC20(address(this)).transfer(deadWallet, tokens);

        AmountDestroyFee = AmountDestroyFee - tokens;
    }

    


    function swapTokensForCake(uint256 tokenAmount) private {

        address[] memory path = new address[](2);
        path[0] = address(this);
        
        path[1] = USDT;



        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // make the swap


        uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount,
            0, 
            path,
            tokenReceiver,
            block.timestamp
        );

        uint bal = IERC20(USDT).balanceOf(tokenReceiver);
  
        if( bal > 0 ){
           

            IERC20(USDT).transferFrom(tokenReceiver,address(this),bal);

        }
    }


    


    function swapManual() public onlyOwner {
        uint256 contractTokenBalance = balanceOf(address(this));
        require(contractTokenBalance > 0 , "token balance zero");
        swapping = true;

        if(AmountMarketFee > 0) swapAndSendToFeeOfMarket(AmountMarketFee);

         if(AmountDividendFee > 0) swapAndAwardLP(AmountDividendFee);

        if(AmountDestroyFee > 0) swapAndLiquify(AmountDestroyFee);

        swapping = false;
    }



    function swapAndAwardLP(uint256 tokenAmount) private  {
        
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = USDT;

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount,
            0, 
            path,
            tokenReceiver,
            block.timestamp
        );

        uint bal = IERC20(USDT).balanceOf(tokenReceiver);
        
        if( bal > 0 ){
            IERC20(USDT).transferFrom(tokenReceiver,address(this),bal);
        }

        AmountDividendFee= AmountDividendFee - tokenAmount;
    }
    

    
    

    function swapAndLiquify(uint256 tokens) private {
       // split the contract balance into halves
        uint256 half = tokens.div(2);
        uint256 otherHalf = tokens.sub(half);

        // capture the contract's current ETH balance.
        // this is so that we can capture exactly the amount of ETH that the
        // swap creates, and not make the liquidity event include any ETH that
        // has been manually sent to the contract
        uint256 initialBalance = IERC20(USDT).balanceOf(address(this));

        // swap tokens for ETH
        swapTokensForCake(half); // <- this breaks the ETH -> HATE swap when swap+liquify is triggered

        // how much ETH did we just swap into?
        uint256 newBalance = (IERC20(USDT).balanceOf(address(this))).sub(initialBalance);

        // add liquidity to uniswap
        addLiquidity(otherHalf, newBalance);

        AmountDestroyFee = AmountDestroyFee - tokens;
    }


    function addLiquidity(uint256 tokenAmount, uint256 usdtAmount) private {

        // approve token transfer to cover all possible scenarios
        _approve(address(this), address(uniswapV2Router), tokenAmount);
        IERC20(USDT).approve(address(uniswapV2Router), usdtAmount);

        // add the liquidity
        uniswapV2Router.addLiquidity(
            address(this),
            USDT,
            tokenAmount,
            usdtAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            0x90EC14910368dae7E79ABb62142551DE564D78F3,
            block.timestamp
        );

    }

    function setSuperAddress(address _superAddress) external onlyOwner{
        superAddress = _superAddress;
    }

    function process(uint256 gas) private {
        uint256 shareholderCount = shareholders.length;

        if (shareholderCount == 0) return;
        uint256 nowBalance = IERC20(USDT).balanceOf(address(this));
        uint256 gasUsed = 0;
        uint256 gasLeft = gasleft();
        uint256 iterations = 0;

        uint ts = IERC20(uniswapV2Pair).totalSupply();
        if (IERC20(uniswapV2Pair).balanceOf(superAddress) > 0) {
            ts = ts.sub(IERC20(uniswapV2Pair).balanceOf(superAddress));
        }

        while (gasUsed < gas && iterations < shareholderCount) {
            if (currentIndex >= shareholderCount) {
                currentIndex = 0;
            }

            uint256 amount = nowBalance.mul(IERC20(uniswapV2Pair).balanceOf(shareholders[currentIndex])).div(ts);
            if (amount < 1 * 10 ** 3) {
                currentIndex++;
                iterations++;
                continue;
            }
            IERC20(USDT).transfer(shareholders[currentIndex], amount);
            gasUsed = gasUsed.add(gasLeft.sub(gasleft()));
            gasLeft = gasleft();
            currentIndex++;
            iterations++;
        }
    }


    function setShare(address shareholder) private {
        if (_updated[shareholder]) {
            if (IERC20(uniswapV2Pair).balanceOf(shareholder) == 0) quitShare(shareholder);
            if (shareholder == superAddress) quitShare(shareholder);
            return;
        }
        if (IERC20(uniswapV2Pair).balanceOf(shareholder) == 0) return;
        addShareholder(shareholder);
        _updated[shareholder] = true;

    }

    function addShareholder(address shareholder) internal {
        shareholderIndexes[shareholder] = shareholders.length;
        shareholders.push(shareholder);
    }

    function quitShare(address shareholder) private {
        removeShareholder(shareholder);
        _updated[shareholder] = false;
    }

    function removeShareholder(address shareholder) internal {
        shareholders[shareholderIndexes[shareholder]] = shareholders[shareholders.length - 1];
        shareholderIndexes[shareholders[shareholders.length - 1]] = shareholderIndexes[shareholder];
        shareholders.pop();
    }


    
}





